/**
 * Note: The returned array must be malloced, assume caller calls free().
 */
int* sortArrayByParityII(int* A, int ASize, int* returnSize){
    int odd = 1;
    int even = 0;
    int *res = malloc(sizeof(int)*(ASize));
    *returnSize = ASize;
    for (size_t i = 0; i < ASize; i++)
    {
        if(A[i] % 2 == 0)
        {
            res[even] = A[i];
            even += 2;
        }
        else
        {
            res[odd] = A[i];
            odd += 2;
        }
    }
    return res;
}

